using System;\nusing System.Collections.Generic;\nusing System.Data.SqlClient;\n\npublic class DatabaseHandler\n{\n    private string connectionString = "YourConnectionString";\n\n    public void InsertUserEntries(int userId, List<string> values)\n    {\n        using (SqlConnection connection = new SqlConnection(connectionString))\n        {\n            connection.Open();\n            using (SqlCommand command = new SqlCommand())\n            {\n                command.Connection = connection;\n                command.CommandText = @"\n                    INSERT INTO UserEntries (UserID, EntryNumber, Value)\n                    VALUES (@UserID, @EntryNumber, @Value)";\n\n                for (int i = 0; i < values.Count; i++)\n                {\n                    command.Parameters.Clear();\n                    command.Parameters.AddWithValue("@UserID", userId);\n                    command.Parameters.AddWithValue("@EntryNumber", i + 1);\n                    command.Parameters.AddWithValue("@Value", values[i]);\n                    command.ExecuteNonQuery();\n                }\n            }\n        }\n    }\n}